/*
快手极速版-接口版

签到和翻倍，开宝箱和翻倍，看广告任务，逛街任务，抽奖和翻倍，广告任务
金币每天0点自动兑换到现金余额
捉api_client_salt需要root的安卓机或9.1.11及以下的IOS版本

变量：
ksjsbCookie：必填，账号ck，多账号用换行隔开。格式 export ksjsbCookie="kuaishou.api_st=xxxxx; did=aaaaaaaa; kuaishou.api_client_salt=bbbbbbbb;"
ksjsbapitoken：选填，接口token，自己找渠道获取。不填则不会做大部分任务
ksjsbCash：选填，固定提现额度，默认为空，即按照列表[50,20,10,3]提现
withdrawTime：选填，提现时间，默认为早10点。可自定义小时，多个时间用逗号隔开，如： export ksjsbWithdrawTime="8,19"
ksjsbNotify：选填，推送开关。0：不通知，1：提现时间通知，2：每次运行通知。默认为1

定时一天10次以上，最好改掉默认时间，不然太多人同一时间跑

重写：
[task_local]
#快手极速版
38 7-22 * * * https://raw.githubusercontent.com/leafTheFish/DeathNote/main/ksjsb_v2.js, tag=快手极速版, enabled=true
[rewrite_local]
appsupport/yoda/biz/info url script-request-header https://raw.githubusercontent.com/leafTheFish/DeathNote/main/ksjsb_v2.js
ksapp/client/package/renew url script-request-header https://raw.githubusercontent.com/leafTheFish/DeathNote/main/ksjsb_v2.js
[MITM]
#IOS用第一个，安卓用第二个
hostname = api.kuaisho*.com
hostname = open.kuaisho*.com

const jsname = '快手极速版-接口版'
*/
